_.each(datos.SiLens,function (el, index) {
	// Aseguramo que los datos esten ordenados por fecha
	datos.SiLens[index].data = _.sortBy(datos.SiLens[index].data,function(a){
	  return a[0];
	})
	 
	 // Construimos un nuevo arreglo y lo insertamos al espacio de trabajo.
	datos.SiLens[index].managed = _.map(datos.SiLens[index].data,function(a,i){
		// Si es el pimero de la lista se resta a si mismo
		b = (i === datos.SiLens[index].data.length - 1 ) ? 0 : 1;
		// log(i + " " + datos.SiLens[index].data.length + " " + b);
		xi = new XDate(datos.SiLens[index].data[i][0],true);
		xo = new XDate(datos.SiLens[index].data[ i + b][0],true);
		inicio = xi.toString("HH:mm");
		final = xo.toString("HH:mm");
		// log(inicio + " " + final);
		diff = Math.floor(Math.abs(xi.diffMinutes(xo)));
		day = xi.toString("ddd");
		date = xi.toString('dd-MMM');
		hour = xi.toString("HH:mm");

		return [
			datos.SiLens[index].name, 	// Maquina
			day, 								// dia Mon
			date, 							// fecha 23-Jan
			inicio,					 		// Inicio hh:mm
			final,					 		// Final  hh:mm
			diff, 							// Tiempo Total
			a[1]								// Tiempo de ciclo
		].join(',');
	}).join('\n');
	// log(datos.SiLens[index].managed);
});
